description:
The Pretenders are an Anglo-American rock band. The original band consisted of group founder and main songwriter, Chrissie Hynde (lead vocals / rhythm guitar), James Honeyman-Scott (lead guitar / backing vocals / keyboards), Pete Farndon (bass guitar / backing vocals), and Martin Chambers (drums / backing vocals / percussion). The band was fractured by drug-related deaths and numerous subsequent personnel changes have taken place over the years, with Hynde as the sole constant.






